import React from 'react';
import Grid from '@material-ui/core/Grid';
import { FILTER_LABELS } from 'shared/constants/stringConstantsSelectors';
import { VERSIONS } from 'shared/constants/domainConstantSelectors';
import { SingleSelect } from 'components/components/componentscommon/input/selects/singleSelect';

export const VersionsFilters = props => {

    return (
        <Grid item xs={1}>
            <SingleSelect 
                handleFilterChange={props.handleFilterByVersion} 
                inputLabel={FILTER_LABELS.VERSIONS}
                menuItems={VERSIONS}
            />
        </Grid>
    );

};
